com/Operators_band","twitterScreenName":"Operators_band"},{"id":1754157,"name":"Ports of Spain","startTime":null,"eventDescription":"From the back of the bar, Ports of Spain instantly scan as a full band, so it's a shock to discover their mathy shoegaze-pop is constructed by just two musicians. Ilya Gitelman uses octave pedals and loops to play lead, bass and rhythm guitar simultaneously, while Sam Carlson contributes vocals, keyboards and drums. Don't be fooled -- Ports of Spain are not another band that trades directionless loopy jazz odysseys for pure songcraft. Their equipment never gets in the way of their complex melodies. They write actual songs, consistently avoiding complication for the sake of complication. They juggle tons of ideas in every song, creating a noise that's consistently about to fall apart. That it doesn't is incredible by itself. Their brilliant songs may seem like a bonus under these circumstances, but don't underrate Ports of Spain. Even as these two guys spew chaos into crowded clubs, their songwriting is always there to remind you why a grounding in planned songcraft keeps so many of the best bands tethered to excellence. Ports of Spain belong in their company. Ports of Spain have played with bands like Tera Melos, Hospitality, Beach Fossils, Fang Island, Pissed Jeans, Pile, ONWE, Speedy Ortiz, Morning Teleportation, Kal Marks, and Solids.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/35/26/95-atjmbo.png","width":960,"height":1451},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/35/26/95-atjmbo1.png","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/35/26/95-atlg.png","width":300,"height":454},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/35/26/95-atlg1.png","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/35/26/95-atmd.png","width":200,"height":302},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/35/26/95-atmd1.png","width":200,"he